  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

}
<h1>hello </h1>

<nav class="navbar navbar-expand-lg bg-body-tertiary">>

  <a class="btn btn-primary" href="#" role="button">Link</a>
